  "1_north_4_lifts": "లిఫ్ట్ వచ్చే వరకు నేరుగా ముందుకు వెళ్లండి\nలిఫ్ట్‌లోకి ఎక్కి FOB చేరుకున్న తర్వాత కుడివైపు తిరగండి\nప్లాట్‌ఫాం 8 చేరుకునేవరకు నేరుగా వెళ్లండి\nమీ కుడివైపు లిఫ్ట్ ద్వారా దిగండి\nతిరిగి నేరుగా ముందుకు వెళ్లండి, మీ గమ్యస్థానం కొద్దిదూరంలో ఉంది",
  "1_north_4_escalator": "గేట్ 2 వద్ద ఎస్కలేటర్ కనిపించే వరకు నేరుగా ముందుకు వెళ్లండి\nఎస్కలేటర్‌పైకి ఎక్కండి\nFOBకి కుడివైపు తిరిగి ప్లాట్‌ఫాం 8 (బోర్డు) వరకు నేరుగా వెళ్లండి\nమీ కుడివైపు ఎస్కలేటర్ ద్వారా దిగండి\nనేరుగా ముందుకు వెళ్లండి, గేట్ 4 మీ ఎడమవైపున ఉంది",
  "1_north_4_ramps": "గేట్ 2 పక్కన ర్యాంప్ ఎక్కి నేరుగా ముందుకు వెళ్లండి\nకుడివైపు తిరిగి ప్లాట్‌ఫాం 8 చేరుకునేవరకు నేరుగా వెళ్లండి\nకుడివైపు తిరిగి ర్యాంప్ ద్వారా దిగండి\nనేరుగా ముందుకు వెళ్లండి, గేట్ 4 మీ ఎడమవైపున ఉంది",
  "1_north_5_stairs": "మీరు మెట్లు వచ్చే వరకు నేరుగా ముందుకు వెళ్లండి\nమెట్లపైకి ఎక్కి ఎడమవైపు తిరగండి\nప్లాట్‌ఫాం 8 చేరుకునేవరకు నేరుగా వెళ్లండి\nమీ ఎడమవైపు మెట్లు దిగండి\nనేరుగా ముందుకు వెళ్లండి, గేట్ 5 మీ కుడివైపున ఉంది",
