  "1_north_14_ramps": "నేరుగా వెళ్లండి, గేట్ 1 మీ ఎడమవైపున ఉంటుంది\nఎడమవైపు తిరిగి గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు సాగండి\nమెయిన్ ఆర్చ్ చేరే వరకు ముందుకు సాగండి\nబీచ్ చేరడానికి వాహనం ఎంచుకోండి",
  "1_north_15_stairs": "ముందుకు సాగండి, మీరు మెట్లు చేరే వరకు\nమెట్లపైకి వెళ్లి ఎడమవైపు తిరగండి\nప్లాట్ఫారమ్ 8 చేరే వరకు నేరుగా వెళ్లండి\nమీ ఎడమవైపు మెట్ల దిగి నేరుగా వెళ్లండి, గేట్ 4 మీ కుడివైపున ఉంటుంది\nకుడివైపు తిరిగి ముందుకు సాగండి, మీరు ఆర్చ్ చేరే వరకు\nజనాపురం చేరడానికి వాహనం ఎంచుకోండి",
  "1_north_15_lifts": "లిఫ్ట్ చేరే వరకు నేరుగా వెళ్లండి\nలిఫ్ట్పైకి వెళ్లి FOB చేరిన తర్వాత కుడివైపు తిరగండి\nప్లాట్ఫారమ్ 8 చేరే వరకు నేరుగా వెళ్లండి\nమీ కుడివైపు లిఫ్ట్ దిగండి\nఅబౌట్ టర్న్ చేసి నేరుగా వెళ్లండి, గేట్ 4 మీ కుడివైపున ఉంటుంది\nకుడివైపు తిరిగి ముందుకు సాగండి, మీరు ఆర్చ్ చేరే వరకు\nజనాపురం చేరడానికి వాహనం ఎంచుకోండి",
  "1_north_15_escalator": "గేట్ 2 వద్ద ఎస్కలేటర్ కనిపించే వరకు నేరుగా వెళ్లండి\nఎస్కలేటర్పైకి వెళ్లండి\nFOB కు కుడివైపు తిరిగి ప్లాట్ఫారమ్ 8 చేరే వరకు ముందుకు సాగండి\nమీ కుడివైపు ఎస్కలేటర్ దిగి నేరుగా వెళ్లండి, గేట్ 4 మీ ఎడమవైపున ఉంటుంది\nఎడమవైపు తిరిగి ముందుకు సాగండి, మీరు ఆర్చ్ చేరే వరకు\nజనాపురం చేరడానికి వాహనం ఎంచుకోండి",
  "1_north_15_ramps": "గేట్ 2 పక్కన ఉన్న రాంప్ ఎక్కండి\nకుడివైపు తిరిగి ప్లాట్ఫారమ్ 8 చేరే వరకు నేరుగా వెళ్లండి\nకుడివైపు తిరిగి రాంప్ దిగి నేరుగా వెళ్లండి, గేట్ 4 మీ ఎడమవైపున ఉంటుంది\nఎడమవైపు తిరిగి ముందుకు సాగండి, మీరు ఆర్చ్ చేరే వరకు\nజనాపురం చేరడానికి వాహనం ఎంచుకోండి",
  "1_north_16_stairs": "మెట్లు వచ్చే వరకు ముందుకు వెళ్లండి\nమెట్లు ఎక్కి ఎడమవైపు తిరగండి\nనేరుగా వెళ్లండి, ప్లాట్‌ఫారమ్ 8 వచ్చే వరకు\nమీ ఎడమవైపు మెట్ల ద్వారా దిగండి మరియు నేరుగా వెళ్లండి, గేట్ 4 మీ కుడివైపున ఉంటుంది\nకుడివైపు తిరిగి ముందుకు వెళ్లండి, ఆర్చ్ వచ్చే వరకు\nకాన్వెంట్ జంక్షన్ చేరేందుకు వాహనం ఎంచుకోండి",
  "1_north_16_lifts": "లిఫ్ట్ వచ్చే వరకు నేరుగా వెళ్లండి\nలిఫ్ట్ ఎక్కండి మరియు FOB వద్ద కుడివైపు తిరగండి\nప్లాట్‌ఫారమ్ 8 వచ్చే వరకు నేరుగా వెళ్లండి\nమీ కుడివైపు లిఫ్ట్ ద్వారా దిగండి\nఅక్కడ నుంచి యూటర్న్ తీసుకుని నేరుగా వెళ్లండి, గేట్ 4 మీ కుడివైపున ఉంటుంది\nకుడివైపు తిరిగి ముందుకు వెళ్లండి, ఆర్చ్ వచ్చే వరకు\nకాన్వెంట్ జంక్షన్ చేరేందుకు వాహనం ఎంచుకోండి",
  "1_north_16_escalator": "గేట్ 2 వద్ద ఎస్కలేటర్ కనిపించే వరకు నేరుగా వెళ్లండి\nఎస్కలేటర్ ఎక్కండి\nకుడివైపు FOB వైపు తిరిగి ప్లాట్‌ఫారమ్ 8 వచ్చే వరకు నేరుగా వెళ్లండి\nమీ కుడివైపు ఎస్కలేటర్ ద్వారా దిగండి మరియు నేరుగా వెళ్లండి, గేట్ 4 మీ ఎడమవైపున ఉంటుంది\nఎడమవైపు తిరిగి ముందుకు వెళ్లండి, ఆర్చ్ వచ్చే వరకు\nకాన్వెంట్ జంక్షన్ చేరేందుకు వాహనం ఎంచుకోండి",
  "1_north_16_ramps": "గేట్ 2 పక్కన ఉన్న రాంప్ ఎక్కుతూ నేరుగా వెళ్లండి\nకుడివైపు తిరిగి నేరుగా వెళ్లండి, ప్లాట్‌ఫారమ్ 8 వచ్చే వరకు\nకుడివైపు తిరిగి రాంప్ ద్వారా దిగండి మరియు నేరుగా వెళ్లండి, గేట్ 4 మీ ఎడమవైపున ఉంటుంది\nఎడమవైపు తిరిగి ముందుకు వెళ్లండి, ఆర్చ్ వచ్చే వరకు\nకాన్వెంట్ జంక్షన్ చేరేందుకు వాహనం ఎంచుకోండి",
