  "1_south_4_stairs": "ప్లాట్‌ఫారం ఎదుటి వైపున మెట్లు కనిపించే వరకు నేరుగా వెళ్లండి\nమెట్లు ఎక్కి FOBపై కుడివైపు త్రిప్పండి\nముందుకు వెళ్లండి, మీరు ప్లాట్‌ఫాం 8కు వచ్చారు\nమెట్లు దిగండి (ముందుకు వెళ్లండి) లేదా లిఫ్టు ఎక్కండి (ఓ మారు తిరుగు)\nనేరుగా వెళ్లండి, కొద్ది దూరంలో మీ కుడివైపు గేట్ 4 ఉంటుంది",
