  "1_south_4_escalator": "గేట్ 2 వద్ద ఉన్న ర్యాంప్ వరకూ నేరుగా వెళ్లండి\nమీ కుడివైపు ఉన్న ఎస్కలేటర్ వైపు వెళ్లండి\nఎస్కలేటర్ ఎక్కండి\nFOB పై కుడివైపు త్రిప్పి ముందుకు వెళ్లండి, ప్లాట్‌ఫాం 8కి చేరుకుంటారు\nమీ కుడివైపు ఉన్న ఎస్కలేటర్ ద్వారా దిగండి\nమీ ఎడమవైపు గేట్ 4 ఉంటుంది",
  "1_south_4_ramps": "నేరుగా వెళ్లండి, గేట్ 3 పక్కన ఉన్న ర్యాంప్ ఎక్కండి\nఎడమవైపు త్రిప్పి నేరుగా వెళ్లండి ప్లాట్‌ఫాం 8కు చేరేవరకు\nకుడివైపు త్రిప్పి ర్యాంప్ ద్వారా దిగండి\nనేరుగా వెళ్లండి, గేట్ 4 వచ్చేదాకా",
