  "1_south_5_escalator": "గేట్ 2 వద్ద ఎస్కలేటర్ వరకు నేరుగా వెళ్లండి\nఎస్కలేటర్ ఎక్కి సెంట్రల్ FOBపైకి వెళ్లండి\nప్లాట్‌ఫాం 8 వరకు నేరుగా వెళ్లండి\nఎస్కలేటర్ దిగండి\nముందుకు వెళ్లండి, మీ కుడివైపు గేట్ 5 ఉంటుంది",
