  "2_south_14_escalator": "మీరు ఎస్కలేటర్ చూసే వరకు నేరుగా వెళ్లండి\nఎస్కలేటర్‌పైకి ఎక్కండి\nFOB వైపు ఎడమకు తిరిగి ప్లాట్‌ఫాం 1 (బోర్డ్) వరకు ముందుకు వెళ్లండి\nమీ ఎడమవైపు ఉన్న ఎస్కలేటర్ ద్వారా కిందకు దిగండి\nనేరుగా వెళ్తే గేట్ 1 మీ కుడివైపు ఉంటుంది\nప్రధాన ఆర్చ్ వరకు ముందుకు వెళ్లండి\nబీచ్ చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "2_south_14_ramps": "మీరు ర్యాంప్ చూసే వరకు నేరుగా వెళ్లి ర్యాంప్‌పై ఎక్కండి\nఎడమవైపు తిరిగి ప్లాట్‌ఫారం 1 చేరే వరకు నేరుగా వెళ్లండి\nఎడమవైపు తిరిగి ర్యాంప్ ద్వారా కిందకి దిగండి\nగేట్ 3 మరియు గేట్ 2 దాటి నేరుగా వెళ్లండి, గేట్ 1 మీ కుడివైపు ఉంటుంది\nఎడమవైపు తిరిగి గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు వెళ్లండి\nప్రధాన ఆర్చ్ వరకు ముందుకు వెళ్లండి\nబీచ్ చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
