  "3_north_7_lifts": "మీరు లిఫ్ట్ చూసే వరకు నేరుగా వెళ్లండి\nలిఫ్ట్‌లో ఎక్కి, FOB చేరిన తరువాత ఎడమవైపు తిరగండి\nప్లాట్‌ఫాం 1 చేరే వరకు నేరుగా వెళ్లండి\nమీ ఎడమవైపు ఉన్న లిఫ్ట్ ద్వారా కిందకి దిగండి\nవెనక్కి తిరిగి నేరుగా వెళ్తే, గేట్ 1 మీ ఎడమవైపు ఉంటుంది\nఎడమవైపు తిరిగి గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు వెళ్లండి\nప్రధాన ద్వారం వరకు ముందుకు వెళ్లండి\nరైల్వే న్యూ కాలనీకి చేరుకోవడానికి ఒక వాహనాన్ని ఎంచుకోండి",
