  "4_north_15_lifts": "లిఫ్ట్ చేరుకునే వరకు సరళంగా కదలండి\nలిఫ్ట్‌లో ఎక్కి, FOB చేరిన తర్వాత కుడివైపు తిరగండి\nప్లాట్‌ఫారమ్ 8 చేరుకునే వరకు సరళంగా కదలండి\nమీ కుడివైపున ఉన్న లిఫ్ట్ ద్వారా కిందకి దిగండి\nవెనక్కి తిరిగి సరళంగా కదలండి, గేట్ 4 మీ కుడివైపున ఉంటుంది\nకుడివైపు తిరగండి మరియు ఆర్చ్‌కి చేరుకునే వరకు ముందుకు కదలండి\nజానపురం చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
