  "4_middle_7_lifts": "లిఫ్ట్ చేరుకునే వరకు సరళంగా కదలండి\nలిఫ్ట్‌లో ఎక్కి, FOB చేరిన తర్వాత ఎడమవైపు తిరగండి\nప్లాట్‌ఫారమ్ 1 చేరుకునే వరకు సరళంగా కదలండి\nమీ ఎడమవైపున ఉన్న లిఫ్ట్ ద్వారా కిందకి దిగండి\nవెనక్కి తిరిగి సరళంగా కదలండి, గేట్ 1 మీ ఎడమవైపున ఉంటుంది\nఎడమవైపు తిరగండి, గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు కదలండి\nప్రధాన ఆర్చ్ చేరుకునే వరకు ముందుకు కదలండి\nరైల్వే న్యూ కాలనీ చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "4_middle_7_ramps": "మీరు ఒక ర్యాంప్ చూసే వరకు సరళంగా కదలండి మరియు ర్యాంప్‌ని ఎక్కండి\nఎడమవైపు తిరగండి, ప్లాట్‌ఫారమ్ 1 చేరుకునే వరకు సరళంగా కదలండి\nఎడమవైపు తిరగండి, ర్యాంప్ ద్వారా కిందకి దిగండి\nగేట్ 3 మరియు గేట్ 2 దాటి సరళంగా కదలండి, గేట్ 1 మీ కుడివైపున ఉంటుంది\nఎడమవైపు తిరగండి, గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు కదలండి\nప్రధాన ఆర్చ్ చేరుకునే వరకు ముందుకు కదలండి\nరైల్వే న్యూ కాలనీ చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "4_middle_8_stairs": "లిఫ్ట్ పక్కన మెట్లు చూసే వరకు ముందుకు కదలండి\nమెట్లు ఎక్కి కుడివైపు తిరగండి\nప్లాట్‌ఫారమ్ 1 చేరుకునే వరకు సరళంగా వెళ్ళండి\nసరళంగా కదలండి, గేట్ 1 మీ ఎడమవైపున ఉంటుంది\nకుడివైపు తిరగండి, గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు కదలండి\nప్రధాన ఆర్చ్ చేరుకునే వరకు ముందుకు కదలండి\nఅక్కయ్యపాలెం చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "4_middle_8_lifts": "లిఫ్ట్ చేరుకునే వరకు సరళంగా కదలండి\nలిఫ్ట్‌లో ఎక్కి, FOB చేరిన తర్వాత ఎడమవైపు తిరగండి\nప్లాట్‌ఫారమ్ 1 చేరుకునే వరకు సరళంగా కదలండి\nమీ ఎడమవైపున ఉన్న లిఫ్ట్ ద్వారా కిందకి దిగండి\nవెనక్కి తిరిగి సరళంగా కదలండి, గేట్ 1 మీ ఎడమవైపున ఉంటుంది\nఎడమవైపు తిరగండి, గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు కదలండి\nప్రధాన ఆర్చ్ చేరుకునే వరకు ముందుకు కదలండి\nఅక్కయ్యపాలెం చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "4_middle_8_escalator": "మీరు ఎస్కలేటర్‌ని చూసే వరకు సరళంగా కదులుతారు\nఎస్కలేటర్‌పై ఎక్కండి\nఎడమవైపుకి తిరిగి FOB వైపుకి వెళ్లి ప్లాట్‌ఫారమ్ 1 (బోర్డ్) వరకు ముందుకు కదలండి\nమీ ఎడమ వైపున ఉన్న ఎస్కలేటర్ ద్వారా కిందికి దిగండి\nసరళంగా వెళ్లండి, గేట్ 1 మీ కుడి వైపున ఉంటుంది\nప్రధాన ఆర్చ్ వరకు ముందుకు కదలండి\nఅక్కయపాలెం చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "4_middle_8_ramps": "మీరు ర్యాంప్‌ని చూసే వరకు సరళంగా కదిలి ర్యాంప్‌ను ఎక్కండి\nఎడమవైపుకి తిరిగి ప్లాట్‌ఫారమ్ 1 చేరుకునే వరకు సరళంగా కదలండి\nఎడమవైపు తిరిగి ర్యాంప్ ద్వారా కిందికి దిగండి\nగేట్ 3 మరియు గేట్ 2 గుండా సరళంగా కదలండి, గేట్ 1 మీ కుడి వైపున ఉంటుంది\nఎడమవైపుకి తిరిగి గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు కదలండి\nప్రధాన ఆర్చ్ వరకు ముందుకు కదలండి\nఅక్కయపాలెం చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "4_middle_9_stairs": "మీరు లిఫ్ట్ పక్కన ఉన్న మెట్లను చూసే వరకు ముందుకు కదలండి\nమెట్ల మీదికి వెళ్లి కుడివైపుకి తిరగండి\nప్లాట్‌ఫారమ్ 1 చేరుకునే వరకు సరళంగా వెళ్లండి\nసరళంగా కదలండి, గేట్ 1 మీ ఎడమ వైపున ఉంటుంది\nకుడివైపు తిరిగి గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు కదలండి\nప్రధాన ఆర్చ్ వరకు ముందుకు కదలండి\nRTC కాంప్లెక్స్ చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
