  "4_south_6_ramps": "రాంప్ కనిపించే వరకు నేరుగా వెళ్లి, ఆ రాంప్‌పై ఎక్కండి\nఎడమవైపు తిరిగి, ప్లాట్‌ఫారమ్ 1 వరకు నేరుగా వెళ్లండి\nఎడమవైపు తిరిగి, రాంప్ ద్వారా కిందకి దిగండి\nనేరుగా వెళ్లండి, గేటు 3 మీ కుడివైపు ఉంటుంది\nగేటు 1 నుండి బయటకు వచ్చే వరకు ముందుకు వెళ్లండి\nఎడమవైపుకి తిరిగి కొన్ని అడుగులు ముందుకు నడవండి\nమీ గమ్యస్థానం చేరుకున్నారు",
