  "4_south_13_escalator": "ఎస్కలేటర్ కనిపించే వరకు నేరుగా వెళ్లండి\nఎస్కలేటర్‌పై ఎక్కండి\nఎడమవైపుకి తిరిగి FOB వైపు నేరుగా ప్లాట్‌ఫారమ్ 1 (బోర్డ్) వరకు వెళ్లండి\nమీ ఎడమవైపున ఉన్న ఎస్కలేటర్ ద్వారా కిందకి దిగండి\nనేరుగా వెళ్లండి, గేటు 1 మీ కుడివైపు ఉంటుంది\nప్రధాన ద్వారం వరకు ముందుకు వెళ్లండి\nజగదాంబ చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "4_south_13_ramps": "రాంప్ కనిపించే వరకు నేరుగా వెళ్లి, ఆ రాంప్‌పై ఎక్కండి\nఎడమవైపు తిరిగి, ప్లాట్‌ఫారమ్ 1 వరకు నేరుగా వెళ్లండి\nఎడమవైపు తిరిగి, రాంప్ ద్వారా కిందకి దిగండి\nగేటు 3 మరియు గేటు 2 దాటి నేరుగా వెళ్లండి, గేటు 1 మీ కుడివైపు ఉంటుంది\nఎడమవైపు తిరిగి గేటు 1 నుండి బయటకు వచ్చే వరకు ముందుకు వెళ్లండి\nప్రధాన ద్వారం వరకు ముందుకు వెళ్లండి\nజగదాంబ చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "4_south_14_stairs": "మీరు లిఫ్ట్ పక్కన మెట్లను చూసే వరకు ముందుకు వెళ్లండి\nమెట్ల మీదకు ఎక్కి కుడివైపు తిరగండి\nప్లాట్‌ఫార్మ్ 1 చేరే వరకు సరళంగా వెళ్లండి\nగేట్ 1 మీ ఎడమవైపు ఉండేలా సరళంగా కదలండి\nకుడివైపు తిరిగి గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు వెళ్లండి\nప్రధాన ఆర్చ్ చేరే వరకు ముందుకు వెళ్లండి\nబీచ్ చేరుకోవడానికి ఒక వాహనాన్ని ఎంచుకోండి",
  "4_south_14_lifts": "లిఫ్ట్ చేరే వరకు సరళంగా వెళ్లండి\nలిఫ్ట్ మీదకు ఎక్కి, FOB చేరిన తరువాత ఎడమవైపు తిరగండి\nప్లాట్‌ఫార్మ్ 1 చేరే వరకు సరళంగా వెళ్లండి\nమీ ఎడమవైపు ఉన్న లిఫ్ట్ ద్వారా కిందకి దిగండి\nవెనుకకు తిరిగి, గేట్ 1 మీ ఎడమవైపు ఉండేలా సరళంగా కదలండి\nఎడమవైపు తిరిగి గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు వెళ్లండి\nప్రధాన ఆర్చ్ చేరే వరకు ముందుకు వెళ్లండి\nబీచ్ చేరుకోవడానికి ఒక వాహనాన్ని ఎంచుకోండి",
  "4_south_14_escalator": "ఎస్కలేటర్ కనిపించే వరకు సరళంగా కదలండి\nఎస్కలేటర్ మీదకు ఎక్కండి\nFOB వైపు ఎడమవైపు తిరిగి ప్లాట్‌ఫార్మ్ 1 (బోర్డ్) చేరే వరకు ముందుకు కదలండి\nమీ ఎడమవైపు ఉన్న ఎస్కలేటర్ ద్వారా కిందకి దిగండి\nగేట్ 1 మీ కుడివైపు ఉండేలా సరళంగా కదలండి\nప్రధాన ఆర్చ్ చేరే వరకు ముందుకు వెళ్లండి\nబీచ్ చేరుకోవడానికి ఒక వాహనాన్ని ఎంచుకోండి",
  "4_south_14_ramps": "ర్యాంప్ కనిపించే వరకు సరళంగా వెళ్లి, ర్యాంప్ ఎక్కండి\nఎడమవైపు తిరిగి ప్లాట్‌ఫార్మ్ 1 చేరే వరకు సరళంగా వెళ్లండి\nఎడమవైపు తిరిగి ర్యాంప్ ద్వారా కిందకి దిగండి\nగేట్ 3 మరియు గేట్ 2 దాటి, గేట్ 1 మీ కుడివైపు ఉండేలా సరళంగా కదలండి\nఎడమవైపు తిరిగి గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు వెళ్లండి\nప్రధాన ఆర్చ్ చేరే వరకు ముందుకు వెళ్లండి\nబీచ్ చేరుకోవడానికి ఒక వాహనాన్ని ఎంచుకోండి",
