  "5_north_12_escalator": "ఎస్కలేటర్ చూసే వరకు సరళంగా కదలండి\nఎస్కలేటర్‌పై ఎక్కండి\nFOB వైపు ఎడమవైపు తిరగండి మరియు ప్లాట్‌ఫారమ్ 1 (బోర్డ్) వరకు ముందుకు కదలండి\nమీ ఎడమవైపున ఉన్న ఎస్కలేటర్ ద్వారా కిందకి దిగండి\nసరళంగా కదలండి, గేట్ 1 మీ కుడివైపున ఉంటుంది\nగేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు కదలండి\nప్రధాన ఆర్చ్ చేరుకునే వరకు ముందుకు కదలండి\nNAD జంక్షన్ చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
