  "5_middle_10_lifts": "మీరు లిఫ్ట్‌ని పొందే వరకు సరళంగా కదలండి\nలిఫ్ట్‌పై ఎక్కి FOB చేరుకున్న తర్వాత ఎడమవైపుకి తిరగండి\nప్లాట్‌ఫారమ్ 1 చేరుకునే వరకు సరళంగా కదలండి\nమీ ఎడమ వైపున ఉన్న లిఫ్ట్ ద్వారా కిందికి దిగండి\nవెనక్కి తిరిగి సరళంగా కదలండి, గేట్ 1 మీ ఎడమ వైపున ఉంటుంది\nఎడమవైపుకి తిరిగి గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు కదలండి\nప్రధాన ఆర్చ్ వరకు ముందుకు కదలండి\nవిమానాశ్రయం చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "5_middle_10_escalator": "మీరు ఎస్కలేటర్‌ని చూసే వరకు సరళంగా కదులుతారు\nఎస్కలేటర్‌పై ఎక్కండి\nఎడమవైపుకి తిరిగి FOB వైపుకి వెళ్లి ప్లాట్‌ఫారమ్ 1 (బోర్డ్) వరకు ముందుకు కదలండి\nమీ ఎడమ వైపున ఉన్న ఎస్కలేటర్ ద్వారా కిందికి దిగండి\nసరళంగా కదలండి, గేట్ 1 మీ కుడి వైపున ఉంటుంది\nప్రధాన ఆర్చ్ వరకు ముందుకు కదలండి\nవిమానాశ్రయం చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "5_middle_10_ramps": "మీరు ర్యాంప్‌ని చూసే వరకు సరళంగా కదిలి ర్యాంప్‌ను ఎక్కండి\nఎడమవైపుకి తిరిగి ప్లాట్‌ఫారమ్ 1 చేరుకునే వరకు సరళంగా కదలండి\nఎడమవైపు తిరిగి ర్యాంప్ ద్వారా కిందికి దిగండి\nగేట్ 3 మరియు గేట్ 2 గుండా సరళంగా కదలండి, గేట్ 1 మీ కుడి వైపున ఉంటుంది\nఎడమవైపుకి తిరిగి గేట్ 1 నుండి బయటకు వచ్చే వరకు ముందుకు కదలండి\nప్రధాన ఆర్చ్ వరకు ముందుకు కదలండి\nవిమానాశ్రయం చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "5_middle_11_stairs": "మీరు లిఫ్ట్ పక్కన ఉన్న మెట్లను చూసే వరకు ముందుకు కదలండి\nమెట్ల మీదికి వెళ్లి ఎడమవైపుకి తిరగండి\nప్లాట్‌ఫారమ్ 8 చేరుకునే వరకు సరళంగా వెళ్లండి\nమీ ఎడమ వైపున మెట్ల ద్వారా కిందికి దిగండి\nసరళంగా కదలండి, గేట్ 5 మీ కుడి వైపున ఉంటుంది\nకుడివైపు తిరిగి ఆర్చ్ వరకు ముందుకు కదలండి\nకంచరపాలెం చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "5_middle_11_lifts": "మీరు లిఫ్ట్‌ని పొందే వరకు సరళంగా కదలండి\nలిఫ్ట్‌పై ఎక్కి FOB చేరుకున్న తర్వాత కుడివైపుకి తిరగండి\nప్లాట్‌ఫారమ్ 8 చేరుకునే వరకు సరళంగా కదలండి\nమీ కుడి వైపున ఉన్న లిఫ్ట్ ద్వారా కిందికి దిగండి\nవెనక్కి తిరిగి సరళంగా కదలండి, గేట్ 5 మీ కుడి వైపున ఉంటుంది\nకుడివైపు తిరిగి ఆర్చ్ వరకు ముందుకు కదలండి\nకంచరపాలెం చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
  "5_middle_11_escalator": "మీరు ఎస్కలేటర్‌ని చూసే వరకు సరళంగా కదులుతారు\nఎస్కలేటర్‌పై ఎక్కండి\nకుడివైపుకి తిరిగి FOB వైపుకి వెళ్లి ప్లాట్‌ఫారమ్ 8 (బోర్డ్) వరకు ముందుకు కదలండి\nమీ కుడి వైపున ఉన్న ఎస్కలేటర్ ద్వారా కిందికి దిగండి\nసరళంగా కదలండి, గేట్ 5 మీ ఎడమ వైపున ఉంటుంది\nకుడివైపు తిరిగి ఆర్చ్ వరకు ముందుకు కదలండి\nకంచరపాలెం చేరుకోవడానికి వాహనాన్ని ఎంచుకోండి",
