  "5_south_16_escalator": "ఎస్కలేటర్ కనిపించే వరకు సరళంగా కదలండి\nఎస్కలేటర్ మీదకు ఎక్కండి\nFOB వైపు కుడివైపు తిరిగి ప్లాట్‌ఫార్మ్ 8 (బోర్డ్) చేరే వరకు ముందుకు కదలండి\nమీ కుడివైపు ఉన్న ఎస్కలేటర్ ద్వారా కిందకి దిగండి\nగేట్ 5 మీ ఎడమవైపు ఉండేలా సరళంగా కదలండి\nకుడివైపు తిరిగి ఆర్చ్ చేరే వరకు ముందుకు వెళ్లండి\nకాన్వెంట్ జంక్షన్ చేరుకోవడానికి ఒక వాహనాన్ని ఎంచుకోండి",
