  "6_north_1_stairs": "ఊరిలోకి వెళ్ళేవరకు కాంపు వరకు వెళ్ళండి\nపదభారీ ఎత్తులోకి ఎక్కండి మరియు ఎడమగా తిరుగండి\nసూటిగా వెళ్ళి మీరు ప్లాట్‌ఫామ్ 1 చేరే వరకు\nమీ ఎడమవైపున స్టెయిర్స్ దిగి\nముందుకు వెళ్లి గేట్ 1 మీ ఎడమవైపున ఉంటుంది",
  "6_north_1_lifts": "సూటిగా వెళ్ళి మీరు లిఫ్ట్ వద్ద చేరే వరకు\nఅబౌట్ టర్న్, లిఫ్ట్‌లో ఎక్కండి మరియు FOB చేరాక ఎడమగా తిరుగండి\nసూటిగా వెళ్ళి మీరు ప్లాట్‌ఫామ్ 1 చేరే వరకు\nలిఫ్ట్‌లో ఎక్కి దాని ఎడమవైపున దిగండి\nఅబౌట్ టర్న్ చేసి, గేట్ 1 మీ ఎడమవైపున ఉంటుంది",
