  "6_north_6_lifts": "మీరు లిఫ్ట్‌కు చేరే వరకు సিধాగా వెళ్లండి\nపరిశీలించి, లిఫ్ట్‌లో ఎక్కి FOB చేరుకున్న తర్వాత కుడి వైపు తిరుగండి\nసామాన్యంగా వెళ్లి మీరు ప్లాట్‌ఫారమ్ 8 చేరే వరకు\nమీ బావిలో మెట్ల నుంచి దిగండి\nముందు వెళ్లండి గేట్ 4 మీ కుడి వైపు ఉంటుంది\nకుడి వైపు తిరుగండి మరియు కొన్ని అడుగులు ముందుకు నడవండి\nమీ గమ్యం చేరుకుంది",
  "6_north_6_escalator": "సామాన్యంగా వెళ్లి మీరు ఎస్కేలేటర్‌ను చూడే వరకు\nఎస్కేలేటర్‌లో ఎక్కండి\nFOB వైపు ఎడమ వైపు తిరుగండి మరియు ప్లాట్‌ఫారమ్ 1(Board) వరకు ముందుకు వెళ్లండి\nమీరు గేటు 2ని చేరే వరకు సిధాగా వెళ్లండి\nగేటు 2 నుండి బయటపడి ముందుకు వెళ్లండి\nకుడి వైపు తిరుగండి మరియు కొన్ని అడుగులు ముందుకు నడవండి\nమీ గమ్యం చేరుకుంది",
