  "6_north_10_lifts": "సామాన్యంగా వెళ్లి మీరు లిఫ్ట్‌కు చేరే వరకు\nపరిశీలించి, లిఫ్ట్‌లో ఎక్కి FOB చేరుకున్న తర్వాత లిఫ్ట్ వైపు తిరుగండి\nసామాన్యంగా వెళ్లి మీరు ప్లాట్‌ఫారమ్ 1 చేరే వరకు\nమీ బావిలో లిఫ్ట్ ద్వారా దిగండి\nపరిశీలించి మరియు ముందుకు వెళ్లండి, గేట్ 1 ఎడమ వైపు ఉంటుంది\nముందు వెళ్లి మీరు గేట్ 1 నుండి బయటపడి\nమీ ప్రధాన వానిని ఎంచుకోండి",
  "6_north_10_escalator": "సామాన్యంగా వెళ్లి మీరు ఎస్కేలేటర్‌ను చూడే వరకు\nఎస్కేలేటర్‌లో ఎక్కండి\nFOB వైపు ఎడమ వైపు తిరుగండి మరియు ప్లాట్‌ఫారమ్ 1(Board) వరకు ముందుకు వెళ్లండి\nఎస్కేలేటర్ నుండి దిగండి మీ ఎడమ వైపు\nముందు వెళ్లండి గేట్ 1 మీ కుడి వైపు ఉంటుంది\nముందు వెళ్లి మీరు గేట్ 1 నుండి బయటపడి\nమీ ప్రధాన వానిని ఎంచుకోండి",
  "6_north_10_ramps": "సామాన్యంగా వెళ్లి మీరు రాంప్‌ను చూడే వరకు ఎక్కండి\nఎడమ వైపు తిరుగండి మరియు ప్లాట్‌ఫారమ్ 1 చేరే వరకు ముందుకు వెళ్లండి\nఎడమ వైపు తిరుగండి మరియు రాంప్ ద్వారా దిగండి\nముందు వెళ్లి గేట్ 3, గేట్ 2, గేట్ 1 మీ కుడి వైపు ఉంటుంది\nముందు వెళ్లి మీరు గేట్ 1 నుండి బయటపడి\nమీ ప్రధాన వానిని ఎంచుకోండి",
