  "6_middle_15_lifts": "కేంద్రీయ FOB వైపు నడవండి\nఉత్తర FOB వైపు కదలండి\nమీకు లిఫ్ట్ కనిపిస్తుంది, ఎక్కండి\nఇప్పుడు ఎడమవైపు తిరిగి PF8 వచ్చేవరకు నడవండి\nఇప్పుడు కుడివైపు తిరిగి లిఫ్ట్ ద్వారా దిగండి\nకొన్ని అడుగులు ముందుకు నడవండి, కుడివైపు గేట్ 4 కనిపిస్తుంది\nఆర్చ్ వచ్చే వరకు ముందుకు సాగండి\nజానపురం వెళ్లేందుకు వాహనం ఎంచుకోండి",
  "6_middle_15_escalator": "కేంద్రీయ FOB వైపు నడవండి\nఎస్కలేటర్ ఎక్కండి\nఇప్పుడు కుడివైపు తిరిగి PF8 వచ్చేవరకు నడవండి\nఇప్పుడు కుడివైపు తిరిగి ఎస్కలేటర్ ద్వారా దిగండి\nకొన్ని అడుగులు ముందుకు నడవండి, ఎడమవైపు గేట్ 4 కనిపిస్తుంది\nఆర్చ్ వచ్చే వరకు ముందుకు సాగండి\nజానపురం వెళ్లేందుకు వాహనం ఎంచుకోండి",
