  "6_middle_16_stairs": "కేంద్రీయ FOB వైపు నడవండి\nఉత్తర FOB వైపు కదలండి\nమీకు మెట్లు కనిపిస్తాయి, ఎక్కండి\nఇప్పుడు కుడివైపు తిరిగి PF8 వచ్చేవరకు నడవండి\nఇప్పుడు ఎడమవైపు తిరిగి మెట్ల ద్వారా దిగండి\nకొన్ని అడుగులు ముందుకు నడవండి, కుడివైపు గేట్ 4 కనిపిస్తుంది\nఆర్చ్ వచ్చే వరకు ముందుకు సాగండి\nకాన్‌వెంట్ జంక్షన్ వెళ్లేందుకు వాహనం ఎంచుకోండి",
  "6_middle_16_lifts": "కేంద్రీయ FOB వైపు నడవండి\nఉత్తర FOB వైపు కదలండి\nమీకు లిఫ్ట్ కనిపిస్తుంది, ఎక్కండి\nఇప్పుడు ఎడమవైపు తిరిగి PF8 వచ్చేవరకు నడవండి\nఇప్పుడు కుడివైపు తిరిగి లిఫ్ట్ ద్వారా దిగండి\nకొన్ని అడుగులు ముందుకు నడవండి, కుడివైపు గేట్ 4 కనిపిస్తుంది\nఆర్చ్ వచ్చే వరకు ముందుకు సాగండి\nకాన్‌వెంట్ జంక్షన్ వెళ్లేందుకు వాహనం ఎంచుకోండి",
  "6_middle_16_escalator": "కేంద్రీయ FOB వైపు నడవండి\nఎస్కలేటర్ ఎక్కండి\nఇప్పుడు కుడివైపు తిరిగి PF8 వచ్చేవరకు నడవండి\nఇప్పుడు కుడివైపు తిరిగి ఎస్కలేటర్ ద్వారా దిగండి\nకొన్ని అడుగులు ముందుకు నడవండి, ఎడమవైపు గేట్ 4 కనిపిస్తుంది\nఆర్చ్ వచ్చే వరకు ముందుకు సాగండి\nకాన్‌వెంట్ జంక్షన్ వెళ్లేందుకు వాహనం ఎంచుకోండి",
  "6_middle_16_ramps": "కేంద్రీయ FOB వైపు నడవండి\nదక్షిణ FOB వైపు కదలండి\nమీకు ర్యాంప్ కనిపిస్తుంది, ఎక్కండి\nఇప్పుడు కుడివైపు తిరిగి PF8 వచ్చేవరకు నడవండి\nఇప్పుడు కుడివైపు తిరిగి ర్యాంప్ ద్వారా దిగండి\nకొన్ని అడుగులు ముందుకు నడవండి, ఎడమవైపు గేట్ 4 కనిపిస్తుంది\nఆర్చ్ వచ్చే వరకు ముందుకు సాగండి\nకాన్‌వెంట్ జంక్షన్ వెళ్లేందుకు వాహనం ఎంచుకోండి",
  "6_south_1_stairs": "లిఫ్ట్ పక్కన మెట్లు కనిపించే వరకు ముందుకు వెళ్లండి\nమెట్లపైకి ఎక్కి కుడివైపు తిరగండి\nప్లాట్‌ఫాం 1 చేరేవరకు నేరుగా వెళ్లండి\nకుడివైపు తిరిగి మెట్ల ద్వారా దిగండి\nనేరుగా వెళ్లండి, గేట్ 1 మీ ఎడమవైపు ఉంటుంది",
  "6_south_1_lifts": "లిఫ్ట్ కనిపించే వరకు నేరుగా వెళ్లండి\nలిఫ్ట్ ఎక్కి ఎఫ్‌ఒబి (FOB) చేరిన తర్వాత కుడివైపు తిరగండి\nప్లాట్‌ఫాం 1 చేరేవరకు నేరుగా వెళ్లండి\nఎడమవైపు ఉన్న లిఫ్ట్ ద్వారా దిగండి\nవెనక్కి తిరిగి నేరుగా వెళ్లండి, గేట్ 1 మీ ఎడమవైపు ఉంటుంది",
  "6_south_1_escalator": "ఎస్కలేటర్ కనిపించే వరకు నేరుగా వెళ్లండి\nఎస్కలేటర్ ఎక్కండి\nఎఫ్‌ఒబి వైపు కుడివైపు తిరిగి ప్లాట్‌ఫాం 1 (Board) వరకు నేరుగా వెళ్లండి\nఎడమవైపు ఉన్న ఎస్కలేటర్ ద్వారా దిగండి\nనేరుగా వెళ్లండి, గేట్ 1 మీ కుడివైపు ఉంటుంది",
  "6_south_1_ramps": "ర్యాంప్ కనిపించే వరకు నేరుగా వెళ్లి ర్యాంప్ ఎక్కండి\nఎడమవైపు తిరిగి నేరుగా వెళ్లి ప్లాట్‌ఫాం 1 చేరుకోండి\nఎడమవైపు తిరిగి ర్యాంప్ ద్వారా దిగండి\nనేరుగా వెళ్లి గేట్ 3 మరియు గేట్ 2ను దాటి, గేట్ 1 మీ కుడివైపు ఉంటుంది",
  "6_south_2_stairs": "మెట్లు కనిపించే వరకు ముందుకు వెళ్లండి\nమెట్లపైకి ఎక్కి కుడివైపు తిరగండి\nప్లాట్‌ఫాం 1 చేరేవరకు నేరుగా వెళ్లండి\nనేరుగా వెళ్లండి, గేట్ 2",
  "6_south_2_lifts": "లిఫ్ట్ కనిపించే వరకు నేరుగా వెళ్లండి\nలిఫ్ట్ ఎక్కి ఎఫ్‌ఒబి చేరిన తర్వాత కుడివైపు తిరగండి\nప్లాట్‌ఫాం 1 చేరేవరకు నేరుగా వెళ్లండి\nఎడమవైపు ఉన్న లిఫ్ట్ ద్వారా దిగండి\nవెనక్కి తిరిగి నేరుగా వెళ్లి గేట్ 1ను దాటి గేట్ 2 మీ ఎడమవైపు ఉంటుంది",
