  "6_south_13_stairs": "లిఫ్ట్ పక్కన ఉన్న సీడ్లు చూసేవరకు ముందుకు వెళ్లండి\nసీడ్లపైకి ఎక్కండి మరియు కుడి వైపుకు తిరగండి\nప్లాట్‌ఫార్మ్ 1 కి చేరేవరకు నేరుగా వెళ్లండి\nకుడి వైపుకు తిరిగి సీడ్లపై దిగండి\nనేరుగా వెళ్లి గేట్ 1 మీ ఎడమవైపుకు ఉంటుంది\nముఖ్యమైన ధార్పత్తు వరకు ముందుకు వెళ్లండి\nజగధంభకు వెళ్లడానికి ఒక వాహనం ఎంచుకోండి",
  "6_south_13_lifts": "లిఫ్ట్ వరకు నేరుగా వెళ్లండి\nలిఫ్ట్‌లో ఎక్కండి మరియు FOB కి చేరుకున్న తర్వాత కుడి వైపుకు తిరగండి\nప్లాట్‌ఫార్మ్ 1 వరకు నేరుగా వెళ్లండి\nలిఫ్ట్‌లో దిగండి, అది మీ ఎడమవైపుకు ఉంటుంది\nతిరిగి తిరిగి గేట్ 1 మీ ఎడమవైపుకు ఉంటుంది\nముఖ్యమైన ధార్పత్తు వరకు ముందుకు వెళ్లండి\nజగధంభకు వెళ్లడానికి ఒక వాహనం ఎంచుకోండి",
