  "6_south_16_lifts": "లిఫ్ట్ వరకు నేరుగా వెళ్లండి\nలిఫ్ట్‌లో ఎక్కండి మరియు FOB కి చేరుకున్న తర్వాత ఎడమ వైపుకు తిరగండి\nప్లాట్‌ఫార్మ్ 8 వరకు నేరుగా వెళ్లండి\nలిఫ్ట్‌లో దిగండి, అది మీ కుడివైపుకు ఉంటుంది\nతిరిగి తిరిగి గేట్ 4 మీ కుడివైపుకు ఉంటుంది\nముఖ్యమైన ధార్పత్తు వరకు ముందుకు వెళ్లండి\nకవెంట్ జంక్షన్ కు వెళ్లడానికి ఒక వాహనం ఎంచుకోండి",
  "6_south_16_escalator": "ఎస్కలేటర్ చూసేవరకు నేరుగా వెళ్లండి\nఎస్కలేటర్‌పై ఎక్కండి\nFOB వైపు ఎడమ తిరిగి ప్లాట్‌ఫార్మ్ 8 వరకు నేరుగా వెళ్లండి (బోర్డింగ్)\nఎస్కలేటర్ ద్వారా దిగండి, అది మీ కుడివైపుకు ఉంటుంది\nనేరుగా వెళ్లి గేట్ 4 మీ ఎడమవైపుకు ఉంటుంది\nముఖ్యమైన ధార్పత్తు వరకు ముందుకు వెళ్లండి\nకవెంట్ జంక్షన్ కు వెళ్లడానికి ఒక వాహనం ఎంచుకోండి",
  "6_south_16_ramps": "రంప్ చూసేవరకు నేరుగా వెళ్లండి మరియు రంప్ మీద చాకి ఎక్కండి\nకుడివైపుకు తిరిగి ప్లాట్‌ఫార్మ్ 8 వరకు నేరుగా వెళ్లండి\nకుడివైపుకు తిరిగి రంప్ ద్వారా దిగండి\nనేరుగా వెళ్లి గేట్ 4 మీ ఎడమవైపుకు ఉంటుంది\nముఖ్యమైన ధార్పత్తు వరకు ముందుకు వెళ్లండి\nకవెంట్ జంక్షన్ కు వెళ్లడానికి ఒక వాహనం ఎంచుకోండి",
