  "8_north_1_stairs": "",
  "8_north_1_stairs": "ముందుకు నడవండి, మెట్లు కనిపించేవరకు\nమెట్లపైకి ఎక్కి ఎడమవైపు తిరగండి\nప్లాట్‌ఫాం 1 వరకు నేరుగా వెళ్లండి\nమీ కుడివైపు మెట్లపై నుంచి దిగండి మరియు కొద్దిగా ముందుకు నడవండి\nఎడమవైపు తిరిగి కొద్దిగా ముందుకు నడవండి, మీ గమ్యం వచ్చింది",
  "8_north_1_lifts": "ఎదురుగా నడవండి, ఎలివేటర్ కనిపించేవరకు\nఎలివేటర్‌కి ఎక్కి, FOBకి వచ్చిన తర్వాత ఎడమవైపు తిరగండి\nప్లాట్‌ఫాం 1 వరకు నేరుగా వెళ్లండి\nమీ ఎడమవైపు ఉన్న ఎలివేటర్‌ ద్వారా దిగండి\nతిరిగి ఎదురుగా మళ్లి నేరుగా నడవండి, కొద్దిగా ముందుగా మీ గమ్యం ఎడమవైపు ఉంటుంది",
  "8_north_1_escalator": "గేట్ 4 వద్ద ఎస్కలేటర్ కనిపించేవరకు నేరుగా నడవండి\nఎస్కలేటర్‌ పైకి ఎక్కండి\nఎడమవైపు FOBకి తిరిగి, ప్లాట్‌ఫాం 1 వరకు నడవండి\nమీ ఎడమవైపు ఎస్కలేటర్ ద్వారా దిగండి\nనేరుగా ముందుకు నడవండి, గేట్ 1 మీ కుడివైపు ఉంటుంది",
  "8_north_1_ramps": "గేట్ 4 పక్కన ఉన్న రాంప్ పైకి ఎక్కుతూ నేరుగా నడవండి\nకుడివైపు తిరిగి ప్లాట్‌ఫాం 1 వరకు నేరుగా వెళ్లండి\nఎడమవైపు తిరిగి రాంప్ ద్వారా దిగండి\nనేరుగా ముందుకు నడవండి, గేట్ 1 మీ కుడివైపు ఉంటుంది",
  "8_north_2_stairs": "ముందుకు నడవండి, మెట్లు కనిపించేవరకు\nమెట్లపైకి ఎక్కి ఎడమవైపు తిరగండి\nప్లాట్‌ఫాం 1 వరకు నేరుగా వెళ్లండి\nమీ కుడివైపు మెట్లపై నుంచి దిగండి మరియు కొద్దిగా ముందుకు నడవండి\nగేట్ 2 మీ ఎడమవైపు ఉంటుంది",
  "8_north_2_lifts": "ఎదురుగా నడవండి, ఎలివేటర్ కనిపించేవరకు\nఎలివేటర్ పైకి ఎక్కి, FOBకి వచ్చిన తర్వాత ఎడమవైపు తిరగండి\nప్లాట్‌ఫాం 1 వరకు నేరుగా వెళ్లండి\nమీ ఎడమవైపు ఎలివేటర్ ద్వారా దిగండి\nతిరిగి ఎదురుగా మళ్లి కొద్దిగా నడవండి, గేట్ 2 మీ ఎడమవైపు ఉంటుంది",
  "8_north_2_escalator": "గేట్ 4 వద్ద ఎస్కలేటర్ కనిపించేవరకు నేరుగా నడవండి\nఎస్కలేటర్ పైకి ఎక్కండి\nఎడమవైపు FOBకి తిరిగి ప్లాట్‌ఫాం 1 వరకు నడవండి\nఎస్కలేటర్ ద్వారా దిగండి (ఎడమవైపు)\nతిరిగి మళ్లీ ఎడమవైపు తిరిగి నడవండి, గేట్ 2 వస్తుంది",
  "8_north_2_ramps": "గేట్ 4 పక్కన ఉన్న రాంప్ పైకి ఎక్కుతూ నేరుగా నడవండి\nకుడివైపు తిరిగి ప్లాట్‌ఫాం 1 వరకు నేరుగా వెళ్లండి\nనేరుగా ముందుకు నడవండి, గేట్ 2 వచ్చింది",
  "8_north_3_stairs": "ముందుకు నడవండి, మెట్లు కనిపించేవరకు\nమెట్లపైకి ఎక్కి ఎడమవైపు తిరగండి\nప్లాట్‌ఫాం 1 వరకు నేరుగా వెళ్లండి\nమీ కుడివైపు మెట్లపై నుంచి దిగండి మరియు కొద్దిగా ముందుకు నడవండి\nగేట్ 3 మీ ఎడమవైపు ఉంటుంది",
  "8_north_3_lifts": "ఎలివేటర్ కనిపించేవరకు ముందుకు నడవండి\nఎలివేటర్ పైకి ఎక్కండి, FOBకి వచ్చిన తర్వాత ఎడమవైపు తిరగండి\nప్లాట్‌ఫాం 1 వరకు నేరుగా నడవండి\nఎడమవైపు ఎలివేటర్ ద్వారా దిగండి\nతిరిగి ఎదురుగా కొద్దిగా నడవండి, గేట్ 3 మీ ఎడమవైపు ఉంటుంది",
  "8_north_3_escalator": "గేట్ 4 వద్ద ఎస్కలేటర్ వరకు నేరుగా నడవండి\nఎస్కలేటర్ పైకి ఎక్కండి\nఎడమవైపు FOBకి తిరిగి ప్లాట్‌ఫాం 1 వరకు నడవండి\nఎడమవైపు ఎస్కలేటర్ ద్వారా దిగండి\nతిరిగి మళ్లీ నేరుగా నడవండి, గేట్ 3 మీ ఎడమవైపు ఉంటుంది",
  "8_north_3_ramps": "గేట్ 5 పక్కన ఉన్న రాంప్ పైకి ఎక్కుతూ నడవండి\nఎడమవైపు తిరిగి ప్లాట్‌ఫాం 1 వరకు నేరుగా నడవండి\nనేరుగా నడవండి, గేట్ 3 వచ్చింది",
