  "8_north_7_stairs": "ముందుకు నడవండి, మెట్ల దాకా చేరుకోండి\nమెట్లపైకి ఎక్కి ఎడమవైపు తిరగండి\nనేరుగా వెళ్లి ప్లాట్‌ఫాం 1 కి చేరుకోండి\nమీ కుడివైపు మెట్లు దిగి కొంచెం ముందుకు నడవండి, గేట్ 1 వద్ద ఎడమవైపు తిరగండి\nముందుకు వెళ్లి గేట్ 1 నుండి బయటకు రండి\nముందుకు నడవండి, మెయిన్ ఆర్చ్ కు చేరుకోండి\nరైల్వే న్యూకలనీకి వెళ్లేందుకు వాహనం ఎంచుకోండి",
  "8_north_7_lifts": "లిఫ్ట్ దాకా నేరుగా ముందుకు వెళ్లండి\nలిఫ్ట్ ఎక్కి FOB వద్ద ఎడమవైపు తిరగండి\nనేరుగా వెళ్లి ప్లాట్‌ఫాం 1 కి చేరుకోండి\nమీ ఎడమవైపు లిఫ్ట్ ద్వారా దిగండి\nవెనక్కి తిరిగి నేరుగా వెళ్లి గేట్ 1 చేరుకోండి\nఎడమవైపు తిరిగి గేట్ 1 నుండి బయటకు రండి\nముందుకు నడవండి, మెయిన్ ఆర్చ్ కు చేరుకోండి\nరైల్వే న్యూకలనీకి వెళ్లేందుకు వాహనం ఎంచుకోండి",
