  "8_north_12_lifts": "నేరుగా వెళ్లండి, లిఫ్ట్ దగ్గరకి వెళ్లండి\nలిఫ్ట్ ఎక్కి FOB వద్ద ఎడమవైపు తిరగండి\nనేరుగా వెళ్లండి, ప్లాట్‌ఫారమ్ 1 చేరుకుంటారు\nఎడమవైపు ఉన్న లిఫ్ట్ ద్వారా దిగండి\nతిరిగి వెనక్కి తిరిగి నేరుగా వెళ్లండి, గేట్ 1 కనిపిస్తుంది\nఎడమవైపు తిరిగి ముందుకు వెళ్లి గేట్ 1 నుండి బయటపడండి\nముందుకు వెళ్లండి, ప్రధాన ఆర్చ్ వద్దకు చేరుకోండి\nNAD జంక్షన్‌కి వెళ్లేందుకు వాహనాన్ని ఎంచుకోండి",
