  "8_middle_1_stairs": "కేంద్ర FOB కి వెళ్లండి\nఉత్తర FOB వైపు నడవండి\nనీవు మెట్లను చూడగలవు, వాటిపైకి ఎక్కండి\nకుడివైపు తిరిగి PF1 వరకు నడవండి\nఅక్కడ కుడివైపు మెట్ల ద్వారా దిగండి\nకొద్ది దూరం నడవగానే ఎడమవైపు గేట్ 1 కనిపిస్తుంది",
  "8_middle_1_lifts": "కేంద్ర FOB కి వెళ్లండి\nఉత్తర FOB వైపు నడవండి\nనీవు లిఫ్ట్‌ను చూడగలవు, అప్పుడు తిరిగి దానిపైకి ఎక్కండి\nఎడమవైపు తిరిగి PF1 వరకు నడవండి\nఅక్కడ ఎడమవైపు లిఫ్ట్ ద్వారా దిగండి, తరువాత యు-టర్న్ తీసుకోండి\nకొద్ది దూరం నడవగానే ఎడమవైపు గేట్ 1 కనిపిస్తుంది",
  "8_middle_1_escalator": "కేంద్ర FOB కి వెళ్లి గేట్ 4 వైపు నడవండి\nనీవు ఎస్కలేటర్‌ను చూడగలవు\nదానిపైకి ఎక్కి ఎడమవైపు తిరగండి\nబ్రిడ్జి మీదుగా నడవండి, PF1 వద్ద ఎడమవైపు తిరగండి\nఎస్కలేటర్‌ ద్వారా దిగండి\nకొద్ది దూరం నడవగానే కుడివైపు గేట్ 1 కనిపిస్తుంది",
