  "8_south_13_ramps": "ముందుకు పోవడం ప్రారంభించండి మరియు వాపసు మలచి, గేట్ 5 పక్కన ర్యాంప్ ఎక్కండి\nఎడమ వైపు మలచి, ప్లాట్‌ఫామ్ 1 వరకు నేరుగా వెళ్లండి\nఎడమ వైపున ర్యాంప్ ద్వారా దిగండి\nముందుకు పోవడం ప్రారంభించండి వరకు మీరు గేట్ 1 ను పొందే వరకు\nఎడమ వైపు మలచి గేట్ 1 నుండి బయటికి పోవడం ప్రారంభించండి\nముందుకు పోవడం ప్రారంభించండి వరకు మీరు ప్రధాన ఆర్క్‌ను పొందే వరకు\nజగదాంబ చేరడానికి ఒక వాహనాన్ని ఎంచుకోండి",
