  "1_middle_4_escalator": "केंद्रीय फ़ुटओवर ब्रिज (FOB) की ओर चलें और घड़ी कक्ष की ओर चलें\nअब आप एक एस्केलेटर देख सकते हैं\nउस पर चढ़ें, फिर दाईं ओर मुड़ें\nअब पुल पर चलें जब तक आप प्लेटफ़ॉर्म 8 तक नहीं पहुँचते, फिर दाईं ओर मुड़ें\nएस्केलेटर पर चढ़ें\nबाईं ओर मुड़ें, आपका गंतव्य आ चुका है",
