  "4_middle_10_lifts": "लिफ्ट तक सीधे आगे बढ़ें\nलिफ्ट में चढ़ें और एफओबी पर पहुंचने के बाद बाएं मुड़ें\nप्लेटफॉर्म 1 तक सीधे जाएं\nअपने बाईं ओर लिफ्ट से नीचे उतरें\nपीछे मुड़ें और सीधे आगे बढ़ें, गेट 1 आपके बाईं ओर है\nबाएं मुड़ें और गेट 1 से बाहर निकलने तक आगे बढ़ें\nमुख्य मेहराब तक आगे बढ़ें\nहवाई अड्डे पहुंचने के लिए एक वाहन चुनें",
