  "4_middle_10_ramps": "रैंप देखने तक सीधे आगे बढ़ें और रैंप पर चढ़ें\nबाएं मुड़ें और प्लेटफॉर्म 1 तक सीधे जाएं\nबाएं मुड़ें और रैंप से नीचे उतरें\nगेट 3 और गेट 2 से होते हुए सीधे आगे बढ़ें, गेट 1 आपके दाईं ओर है\nबाएं मुड़ें और गेट 1 से बाहर निकलने तक आगे बढ़ें\nमुख्य मेहराब तक आगे बढ़ें\nहवाई अड्डे पहुंचने के लिए एक वाहन चुनें उतरें\nगेट 3 और गेट 2, से होते हुए सीधे आगे बढ़ें गेट 1 आपके दाईं ओर है",
