  "4_middle_11_lifts": "सीधे चलें जब तक आपको लिफ्ट न मिले\nलिफ्ट पर चढ़ें और FOB पर पहुंचने के बाद दाएं मुड़ें\nसीधे चलते रहें जब तक आप प्लेटफॉर्म 8 तक न पहुंचें\nअपने दाईं ओर की लिफ्ट से नीचे उतरें\nपीछे मुड़ें और सीधे चलें, गेट 4 आपके दाईं ओर है\nदाएं मुड़ें और तब तक आगे बढ़ें जब तक आपको आर्च न मिले\nकंचारपालेम पहुंचने के लिए एक वाहन चुनें",
  "4_middle_11_escalator": "सीधे चलें जब तक आपको एस्केलेटर न दिखे\nएस्केलेटर पर चढ़ें\nFOB पर दाएं मुड़ें और सीधे चलते रहें जब तक प्लेटफॉर्म 8 (बोर्ड) तक न पहुंचें\nअपने दाईं ओर के एस्केलेटर से नीचे उतरें\nसीधे चलें, गेट 4 आपके बाईं ओर है\nदाएं मुड़ें और तब तक आगे बढ़ें जब तक आपको आर्च न मिले\nकंचारपालेम पहुंचने के लिए एक वाहन चुनें",
