  "8_north_1_stairs": "आगे बढ़ें जब तक सीढ़ियाँ दिखाई दें\nसीढ़ियों पर चढ़ें और बाएं मुड़ें\nप्लेटफॉर्म 1 तक सीधे जाएँ\nदाईं ओर से सीढ़ियों से नीचे उतरें और थोड़ा आगे बढ़ें\nबाएं मुड़ें और कुछ कदम चलें, आपका गंतव्य आ गया है",
  "8_north_1_lifts": "आगे सीधे चलें जब तक लिफ्ट न दिखे\nलिफ्ट से ऊपर जाएँ और FOB पर पहुँचने के बाद बाएं मुड़ें\nप्लेटफॉर्म 1 तक सीधे जाएँ\nबाईं ओर लिफ्ट से नीचे उतरें\nपीछे मुड़ें और सीधे चलें, कुछ ही कदम में आपका गंतव्य बाईं ओर है",
  "8_north_1_escalator": "गेट 4 पर एस्केलेटर दिखाई देने तक सीधे चलें\nएस्केलेटर पर चढ़ें\nबाएं मुड़ें और FOB की ओर जाएँ, प्लेटफॉर्म 1 तक आगे बढ़ें\nबाईं ओर एस्केलेटर से नीचे उतरें\nसीधे चलें, गेट 1 आपकी दाईं ओर है",
  "8_north_1_ramps": "गेट 4 के पास रैम्प पर चढ़ते हुए सीधे चलें\nदाईं ओर मुड़ें और प्लेटफॉर्म 1 तक सीधे जाएँ\nबाएं मुड़कर रैम्प से नीचे उतरें\nसीधे चलें, गेट 1 आपकी दाईं ओर है",
  "8_north_2_stairs": "आगे बढ़ें जब तक सीढ़ियाँ न दिखें\nसीढ़ियों पर चढ़ें और बाएं मुड़ें\nप्लेटफॉर्म 1 तक सीधे जाएँ\nदाईं ओर से सीढ़ियों से उतरें और थोड़ा आगे बढ़ें\nगेट 2 आपकी बाईं ओर है",
  "8_north_2_lifts": "सीधे चलें जब तक लिफ्ट न दिखे\nलिफ्ट से ऊपर जाएँ और FOB पर पहुँचकर बाएं मुड़ें\nप्लेटफॉर्म 1 तक आगे बढ़ें\nबाईं ओर लिफ्ट से नीचे उतरें\nपीछे मुड़ें और सीधे चलें, कुछ ही कदम में गेट 2 बाईं ओर है",
  "8_north_2_escalator": "गेट 4 तक सीधे चलें जहाँ एस्केलेटर है\nएस्केलेटर पर चढ़ें\nबाएं मुड़ें और FOB होते हुए प्लेटफॉर्म 1 तक जाएँ\nबाईं ओर से एस्केलेटर से नीचे उतरें\nपीछे मुड़ें, गेट 2 आपकी बाईं ओर है",
  "8_north_2_ramps": "गेट 4 के पास रैम्प पर चढ़ते हुए सीधे चलें\nदाईं ओर मुड़ें और प्लेटफॉर्म 1 तक जाएँ\nसीधे चलें, गेट 2 आ गया है",
  "8_north_3_stairs": "आगे बढ़ें जब तक सीढ़ियाँ न दिखें\nसीढ़ियों पर चढ़ें और बाएं मुड़ें\nप्लेटफॉर्म 1 तक सीधे जाएँ\nदाईं ओर से सीढ़ियों से नीचे उतरें और थोड़ा आगे बढ़ें\nगेट 3 आपकी बाईं ओर है",
  "8_north_3_lifts": "लिफ्ट तक सीधे चलें\nलिफ्ट से ऊपर जाएँ और FOB पर पहुँचने के बाद बाएं मुड़ें\nप्लेटफॉर्म 1 तक जाएँ\nबाईं ओर लिफ्ट से नीचे उतरें\nपीछे मुड़ें और थोड़ा चलें, गेट 3 बाईं ओर है",
  "8_north_3_escalator": "गेट 4 पर एस्केलेटर तक सीधे जाएँ\nएस्केलेटर पर चढ़ें\nबाएं मुड़ें और प्लेटफॉर्म 1 तक FOB होते हुए जाएँ\nबाईं ओर एस्केलेटर से नीचे उतरें\nपीछे मुड़ें और सीधे चलें, गेट 3 आपकी बाईं ओर है",
  "8_north_3_ramps": "गेट 5 के पास रैम्प से चढ़ते हुए चलें\nबाएं मुड़ें और प्लेटफॉर्म 1 तक जाएँ\nसीधे चलें, गेट 3 आ गया है",
