  "8_south_1_stairs": "आगे बढ़ें जब तक आपको सीढ़ियाँ न दिखें\nसीढ़ियों पर चढ़कर दाहिने मुड़ें\nसीधे चलें जब तक आप प्लेटफॉर्म 1 तक नहीं पहुँच जाते\nआपकी दाहिनी ओर कुछ कदम चलकर सीढ़ियों से उतरें\nबाएं मुड़कर कुछ कदम आगे बढ़ें, आपका गंतव्य आ गया है",
