  "8_south_1_escalator": "गेट 4 पर एस्केलेटर दिखने तक सीधे बढ़ें\nयू-टर्न लें और एस्केलेटर में चढ़ें\nबाएं मुड़कर FOB तक चलें और प्लेटफॉर्म 1 तक बढ़ें\nएस्केलेटर से बाईं ओर उतरें\nआगे बढ़ें, गेट 1 आपकी दाहिनी ओर है",
